class Solution(object):
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        def Allnegiborhood(grid,y,x,explored):
            if x+1 < len(grid[0]) and (y,x+1) not in explored:
                if grid[y][x+1] == '1':
                    explored.append((y,x+1))
                    Allnegiborhood(grid,y,x+1,explored)

            if x-1 >= 0 and (y,x-1) not in explored:
                if grid[y][x-1] == '1':
                    explored.append((y,x-1))
                    Allnegiborhood(grid,y,x-1,explored)

            if y+1 < len(grid) and (y+1,x) not in explored:
                if grid[y+1][x] == '1':
                    explored.append((y+1,x))
                    Allnegiborhood(grid,y+1,x,explored)

            if y-1 >= 0 and (y-1,x) not in explored:
                if grid[y-1][x] == '1':
                    explored.append((y-1,x))
                    Allnegiborhood(grid,y-1,x,explored)

            #return explore
        if grid == []:
            return 0
        count = 0
        explored = []
        for x in range(len(grid[0])):
            for y in range(len(grid)):
                if grid[y][x] == '1' and (y,x) not in explored:
                    count += 1
                    Allnegiborhood(grid,y,x,explored)
        return count

